package main

import (
	"sort"
)

// Write a function that accepts a list of strings.
// The list contains different words. Return the word with maximum number
// of unique characters. If multiple strings have maximum number of unique
// characters, return the one which comes first in lexicographical order.
// 
// FindMax(["name", "of", "string"]) == "string"
// FindMax(["name", "enam", "game"]) == "enam"
// FindMax(["aaaaaaa", "bb" ,"cc"]) == ""aaaaaaa"
func FindMax(words []string) string {
	if len(words) == 0 {
		return ""
	}

	// Count unique characters for each word
	uniqueCharCounts := make([]int, len(words))
	for i, word := range words {
		charSet := make(map[rune]bool)
		for _, ch := range word {
			charSet[ch] = true
		}
		uniqueCharCounts[i] = len(charSet)
	}

	// Find the maximum number of unique characters
	maxUnique := 0
	for _, count := range uniqueCharCounts {
		if count > maxUnique {
			maxUnique = count
		}
	}

	// Among words with max unique characters, find the lexicographically smallest
	candidates := []string{}
	for i, count := range uniqueCharCounts {
		if count == maxUnique {
			candidates = append(candidates, words[i])
		}
	}

	sort.Strings(candidates)
	return candidates[0]
}
